const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Redis Streams is a Redis data type that represents a log, so you can add new information and message in an append-only mode.
Redis Streams lets you build “Kafka-like” applications, which can:`}</p>
    <ul>
      <li parentName="ul">{`Create applications that publish and consume messages. Nothing extraordinary here, you could already do that with Redis Pub/Sub.`}</li>
      <li parentName="ul">{`Consume messages that are published even when the client application (consumer) is not running. This is a big difference from Redis Pub/Sub.`}</li>
      <li parentName="ul">{`Consume messages starting from a specific point. For example, read the whole history or only new messages. `}</li>
    </ul>
    <p>{`In addition, Redis Streams has the concept of consumer groups. Redis Streams consumer groups, like the similar concept in `}<a parentName="p" {...{
        "href": "https://kafka.apache.org/"
      }}>{`Apache Kafka`}</a>{`, allows client applications to consume messages in a distributed fashion (multiple clients), making it easy to scale and create highly available systems.`}</p>
    <p>{`Let’s dive under the covers and see `}<a parentName="p" {...{
        "href": "https://redis.io/topics/streams-intro"
      }}>{`Redis Streams`}</a>{` through the lens of RedisInsight. You will see how to use `}<a parentName="p" {...{
        "href": "https://developer.redislabs.com/develop/java/#using-lettuce"
      }}>{`Lettuce Java client`}</a>{` to publish and consume messages using consumer groups.This is the first basic example that uses a single consumer.`}</p>
    <h2 {...{
      "id": "prerequisite"
    }}>{`Prerequisite:`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://openjdk.java.net/install/"
        }}>{`Install OpenJDK`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://maven.apache.org/install.html"
        }}>{`Install Apache Maven`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.redislabs.com/create"
        }}>{`Install Redis`}</a></li>
    </ul>
    <h2 {...{
      "id": "step-1-download-redisinsight"
    }}>{`Step 1: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <h2 {...{
      "id": "step-2-cloning-the-repository"
    }}>{`Step 2. Cloning the repository`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/redis-developer/redis-streams-101-java
 cd redis-streams-101-java
 mvn clean verify
`}</code></pre>
    <h2 {...{
      "id": "step-3-run-the-producerpost-a-new-message"
    }}>{`Step 3. Run the producer(Post a new message)`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
 mvn exec:java -Dexec.mainClass="com.kanibl.redis.streams.simple.RedisStreams101Producer" -Dexec.args="5"

 Downloaded from central: https://repo.maven.apache.org/maven2/org/sonatype/sisu/sisu-guice/2.1.7/sisu-guice-2.1.7-noaop.jar (472 kB at 450 kB/s)
 Downloaded from central: https://repo.maven.apache.org/maven2/org/slf4j/slf4j-api/1.7.5/slf4j-api-1.7.5.jar (26 kB at 25 kB/s)
 Downloaded from central: https://repo.maven.apache.org/maven2/commons-codec/commons-codec/1.11/commons-codec-1.11.jar (335 kB at 313 kB/s)

 Sending 5 message(s)
 May 18, 2021 1:07:00 PM io.lettuce.core.EpollProvider <clinit>
 INFO: Starting without optional epoll library
 May 18, 2021 1:07:00 PM io.lettuce.core.KqueueProvider <clinit>
 INFO: Starting without optional kqueue library
       Message 1621343220998-0 : {sensor_ts=1621343220975, loop_info=0, speed=15, direction=270} posted
       Message 1621343221009-0 : {sensor_ts=1621343221007, loop_info=1, speed=15, direction=270} posted
       Message 1621343221016-0 : {sensor_ts=1621343221011, loop_info=2, speed=15, direction=270} posted
       Message 1621343221019-0 : {sensor_ts=1621343221017, loop_info=3, speed=15, direction=270} posted
       Message 1621343221023-0 : {sensor_ts=1621343221021, loop_info=4, speed=15, direction=270} posted


 [INFO] ------------------------------------------------------------------------
 [INFO] BUILD SUCCESS
 [INFO] ------------------------------------------------------------------------
 [INFO] Total time:  9.102 s
 [INFO] Finished at: 2021-05-18T13:07:01Z
 [INFO] ------------------------------------------------------------------------

`}</code></pre>
    <h2 {...{
      "id": "step-4-run-the-consumerconsume-messages"
    }}>{`Step 4. Run the consumer(Consume messages)`}</h2>
    <p>{`Open a new terminal and run this command:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
 mvn exec:java -Dexec.main
`}</code></pre>
    <p>{`The consumer will start and consume the message you just posted, and wait for any new messages.`}</p>
    <h2 {...{
      "id": "step-5-posting-the-new-messages"
    }}>{`Step 5: Posting the new messages`}</h2>
    <p>{`In the first terminal, post 100 new messages:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` mvn exec:java -Dexec.mainClass="com.kanibl.redis.streams.simple.RedisStreams101Producer" -Dexec.args="100"
`}</code></pre>
    <p>{`Let us try to visualise using the RedisInsight browser tool. Make sure ‘Stream Data’ is selected and select any one of the streams. You’ll see a table showing data in that stream along with a timestamp of when each entry was added.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image16.png").default} title="image_tooltip" /></p>
    <p>{`To see the processing side of the stream select ‘Stream Data”. You will see 105 records under the streaming data.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image17.png").default} title="image_tooltip" /></p>
    <p>{`Click on “Consumer Groups” to see application_1 as promising consumer.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image18.png").default} title="image_tooltip" /></p>
    <p>{`RedisInsight also provide you to select fields as shown under “View Columns” section.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image19.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "additional-links"
    }}>{`Additional Links`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/slowlog"
        }}>{`Slowlog Configuration using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
        }}>{`Explore Redis keys using RedisInsight browser tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/memoryanalyzer"
        }}>{`Memory Analysis using RedisInsight`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
